const lines = rawData.split('\n').map(l => l.trim()).filter(Boolean);
const rows = [];
lines.forEach((line) => {
  // –ü—Ä–æ–ø—É—Å–∫–∞–µ–º —Å—Ç—Ä–æ–∫—É, –µ—Å–ª–∏ —ç—Ç–æ –∑–∞–≥–æ–ª–æ–≤–æ–∫ (—Å–æ–¥–µ—Ä–∂–∏—Ç "–ê–±–æ–Ω–µ–Ω—Ç" –∏–ª–∏ "‚Ññ")
  if (/–ê–±–æ–Ω–µ–Ω—Ç|–ø\/–ø|–õ\/–°/i.test(line)) return;
  // –†–∞–∑–¥–µ–ª—è–µ–º –ø–æ TAB
  const cols = line.split('\t').map(c => c.trim()).filter(c => c !== '');
  if (cols.length < 16) return; // –Ω–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ –∫–æ–ª–æ–Ω–æ–∫
  rows.push(cols);
});

let skippedCompany = 0;
let duplicates = 0;
let processed = 0;
const existingPhones = new Set(existing.map(r => r.phone));
const newPhones = new Set();

// –ú–∞–∫—Å–∏–º–∞–ª—å–Ω—ã–π id –≤ —Å—É—â–µ—Å—Ç–≤—É—é—â–∏—Ö
const maxId = existing.reduce((m, r) => Math.max(m, r.id || 0), 0);
let nextId = maxId + 1;

const addResident = (cols) => {
  // –ö–æ–ª–æ–Ω–∫–∏ –ø–æ —Ç—Ä–µ–±–æ–≤–∞–Ω–∏—è–º
  const lic = cols[1] || '';
  const fioRaw = cols[3] || '';
  const dom = cols[8] || '';
  const kv = cols[10] || '';
  const area = cols[15] || '';

  // –§–∏–ª—å—Ç—Ä –∫–æ–º–ø–∞–Ω–∏–π
  if (/–û–û–û/i.test(fioRaw) || /"–°–ó/i.test(fioRaw) || /–û–æ–æ/i.test(fioRaw)) {
    skippedCompany++;
    return;
  }

  const fio = fioRaw.trim().replace(/\s+/g, ' ');
  if (!fio) return;

  // –¢–µ–ª–µ—Ñ–æ–Ω –∏–∑ –õ/–°: +7 + 10 —Ü–∏—Ñ—Ä (–ø–∞–¥–¥–∏–Ω–≥)
  let digits = lic.toString().replace(/\D/g, '');
  if (digits.length < 10) digits = digits.padStart(10, '0');
  else digits = digits.slice(-10);
  const phone = '+7' + digits;
  const code = phone.slice(-4);

  // –ü—Ä–æ–≤–µ—Ä–∫–∞ –¥—É–±–ª–∏–∫–∞—Ç–æ–≤
  if (existingPhones.has(phone) || newPhones.has(phone)) {
    duplicates++;
    return;
  }

  // –ê–¥—Ä–µ—Å
  const address = `–ó–µ–ª–µ–Ω–∞—è –î–æ–ª–∏–Ω–∞ –º–∫—Ä., –¥. ${dom}`;

  // –ö–≤–∞—Ä—Ç–∏—Ä–∞ / –∫–ª–∞–¥–æ–≤–∞—è
  let apartment = '‚Äî';
  let storage = '‚Äî';
  const kvTrim = kv.toString().trim();
  if (/^–∫/i.test(kvTrim)) {
    storage = kvTrim.replace(/^–∫/i, '').trim() || '‚Äî';
  } else if (kvTrim) {
    apartment = kvTrim;
    const num = parseInt(kvTrim, 10);
    storage = Number.isFinite(num) ? Math.floor(num / 10).toString() : '‚Äî';
  }

  const resident = {
    id: nextId++,
    fio,
    phone,
    code,
    address,
    apartment,
    storage,
    complex: '–ó–µ–ª—ë–Ω–∞—è –¥–æ–ª–∏–Ω–∞',
    balance: 0,
    licSchet: lic.toString().trim(),
    area: area.trim()
  };

  newPhones.add(phone);
  existing.push(resident);
  processed++;
};

rows.forEach(addResident);

